function printpdf() {

    let titles = document.getElementsByClassName("collectionBookTitle");
    let content;

    pdfMake.fonts = {
        Roboto: {
            normal: 'Roboto-Regular.ttf',
            bold: 'Roboto-Medium.ttf',
            italics: 'Roboto-Italic.ttf',
            bolditalics: 'Roboto-MediumItalic.ttf',
        },
        ArialUnicode: {
            normal: 'arial-unicode-ms.ttf',
            bold: 'arial-unicode-ms.ttf',
            italics: 'arial-unicode-ms.ttf',
            bolditalics: 'arial-unicode-ms.ttf'
        }
    };




    let books = Promise.resolve(getData(titles));
    console.log(books);
    books.then((data) => {
        console.log(data);
        content = makeContent(data);

        let docDefinition = {
            pageSize: 'LEGAL',
            pageMargins: [0, 0, 53, 0],
            background: {
                image: 'data:image/png;base64,',
            },
            content: content,
            defaultStyle: {
                font: 'ArialUnicode'
            },
            styles: {
                isbn: {
                    fontSize: 13,
                    margin: [53, 0, 0, 0],
                    lineHeight: 1.1,
                },
                author: {
                    fontSize: 16,
                    bold: false,
                    margin: [53, 0, 0, 0],
                    lineHeight: 1.4,
                },
                title: {
                    fontSize: 20,
                    bold: true,
                    margin: [53, 0, 0, 0],
                    lineHeight: 1.1
                },
                thought: {
                    fontSize: 16,
                    margin: [53, 0, 0, 0],

                }
            }
        }

        pdfMake.createPdf(docDefinition).download();
    });

}
function makeContent(data) {
    let content = [{
        image: 'data:image/png;base64,',
        width: 612,
        margin: 0
    }];


    for (let i = 0; i < data.length; i++) {
        let isbn = { text: data[i].isbn.concat('\n'), style: 'isbn' };
        let title = { text: data[i].title, style: 'title' };
        let a = data[i].author.concat('\n');
        let author = { text: a, style: 'author' };
        let thought = { text: data[i].thoughts, style: 'thought' };
        content.push(isbn);
        content.push([title, author]);
        content.push([thought, '\n\n']);
    }
    console.log(content)
    return content;
}

async function getData(titles) {
    const requestURL = "./data.json";
    const request = new Request(requestURL);
    const response = await fetch(request);
    let data = await response.json();

    let selectedBooks = [];

    if (data.length > 0) {
        for (let i = 0; i < titles.length; i++) {

            let book = data.find(obj => {
                return obj.title === titles[i].innerText;
            });

            selectedBooks.push(book);

        }

    }


    return selectedBooks;


}






